import enGB from "antd/es/locale/en_GB";
import enUS from "antd/es/locale/en_US";
import esES from "antd/es/locale/es_ES";
import { Locale } from "antd/lib/locale";

const locales: { [key: string]: Locale } = {
  "en-US": enUS,
  "en-GB": enGB,
  "es-ES": esES,
};

export default locales;
